  {
    "operation": "shift",
    "spec": {
      "*": "accounts.&"
    }
  },
  {
    "operation": "default",
    "spec": {
      "contacts": ${contacts}
    }
  },
  {
    "operation": "shift",
    "spec": {
      "contacts": "contacts",
      "accounts": {
        "data": {
          "*": "accounts.@(id)"
        }
      }
    }
  },
  {
    "operation": "shift",
    "spec": {
      "accounts": "accounts",
      "contacts": {
        "data": {
          "*": {
            "Account_Name": {
              "id": {
                "*": {
                  "@3": "accounts.&.Contact"
                }
              }
            }
          }
        }
      }
    }
  },
  {
    "operation": "shift",
    "spec": {
      "accounts": {
        "*": "data[]"
      }
    }
  },
  {
    "operation": "shift",
    "spec": {
      "data": {
        "*": {
          "id":"response[&1].company_id",
          "OLD_CRM_ID":"response[&1].old_company_id",
          "Account_Name":"response[&1].company_name",
          "Tax_number":"response[&1].ein",
          "Account_Number":"response[&1].account_number",
          "Contact": {
            "Created_Time": "response[&2].date_add",
            "Job_Title": "response[&2].position_title",
            "Description": "response[&2].comment",
            "id": "response[&2].crm_id",
            "uuid": "response[&2].crm_uuid",
            "Country": "response[&2].country_name",
            "#true": "response[&2].active"
          }
        }
      },
      "info": {
        "count": "status"
      }
    }
  },
  {
    "operation": "modify-overwrite-beta",
