import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import org.apache.nifi.processor.io.StreamCallback

def flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def json = new JsonSlurper().parse(inputStream)

    def accounts = (json.accounts ?: [:])
    def contacts = (json.contacts ?: [:])

    def enriched = (json.access ?: []).collect { a ->
        def accountId = a?.Cabinet_Access?.id?.toString()
        def contactId = a?.Cabinet_Access1?.id?.toString()

        // build output element
        def out = [:]
        out.putAll(a) // keep original access fields
        out.account = accountId ? accounts[accountId] : null
        out.contact = contactId ? contacts[contactId] : null
        out
    }

    // choose final shape:
    // 1) replace access array with enriched:
    json.access = enriched

    // (optional) keep/remove lookup maps:
    // json.remove('accounts'); json.remove('contacts')

    outputStream.write(JsonOutput.prettyPrint(JsonOutput.toJson(json)).getBytes('UTF-8'))
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)
